import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route, useLocation, Link } from 'react-router-dom';
import Products from './components/Products/Products';
import RegisterModal from './components/Login/RegisterModal';
import FaqSection from './components/FAQ/FAQSection';
import BottomNavbar from './components/BNB/bottomNavBar';
import LoginModal from './components/Login/LoginModal';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import { FaShoppingCart, FaExchangeAlt, FaDonate, FaSearch, FaShareAlt } from 'react-icons/fa';

// üîπ COMPONENTE NAVBAR PERSONALIZADO
const Navbar = ({ onLogin, onRegister }) => {
  const location = useLocation();
  const isProductosPage = location.pathname === '/productos';

  return (
    <nav className="navbar">
      <div className="navbar-brand">
        <span className="brand-R3">{isProductosPage ? 'Bienvenido a' : '√önete a'}</span>
        <span className="brand-Unete"> R3</span>
      </div>

      {isProductosPage && (
        <div className="navbar-center">
          <Link to="/" className="navbar-link">Home</Link>
          <Link to="/productos" className="navbar-link">Productos</Link>
          <Link to="/foros" className="navbar-link">Foros</Link>
          <Link to="/sobre-nosotros" className="navbar-link">Sobre Nosotros</Link>
        </div>
      )}

      <div className="navbar-buttons">
        {isProductosPage ? (
          <span className="greeting">Hola, Juan bonito</span>
        ) : (
          <>
            <button className="btn-login" onClick={onLogin}>Iniciar Sesi√≥n</button>
            <button className="btn-join" onClick={onRegister}>Unirse</button>
          </>
        )}
      </div>
    </nav>
  );
};

// üîπ COMPONENTE: Podr√°s
const Podras = () => (
  <div className="aliados-container-custom rounded-3xl p-8 bg-[#1A1230] shadow-[0_0_20px_2px_rgba(176,70,255,0.6)]">
    <h2 className="podras-title">PODR√ÅS...</h2>
    <div className="podras-options">
      <div className="podras-option"><FaShoppingCart size={40} /><p>Comprar</p></div>
      <div className="podras-option"><FaExchangeAlt size={40} /><p>Vender</p></div>
      <div className="podras-option"><FaDonate size={40} /><p>Donar</p></div>
      <div className="podras-option"><FaSearch size={40} /><p>Explorar</p></div>
      <div className="podras-option"><FaShareAlt size={40} /><p>Compartir ideas</p></div>
    </div>
  </div>
);

// üîπ COMPONENTE: Rese√±as
const Rese√±as = () => (
  <div className="reviews-section">
    <div className="aliados-container-custom rounded-3xl p-8 bg-[#1A1230] shadow-[0_0_20px_2px_rgba(176,70,255,0.6)]">
      <h2 className="reviews-title">RESE√ëAS</h2>
      <Swiper spaceBetween={20} slidesPerView={1} breakpoints={{ 768: { slidesPerView: 2 }, 1024: { slidesPerView: 3 } }}>
        {[...Array(6)].map((_, i) => (
          <SwiperSlide key={i}>
            <div className="review-card">
              <div className="review-stars">{'‚òÖ'.repeat(3 + (i % 3)) + '‚òÜ'.repeat(5 - (3 + (i % 3)))}</div>
              <p className="review-text">Excelente plataforma, prob√© antes de suscribirme.</p>
            </div>
          </SwiperSlide>
        ))}
      </Swiper>
    </div>
  </div>
);

// üîπ COMPONENTE PRINCIPAL
function App() {
  const [isLoginModalOpen, setIsLoginModalOpen] = useState(false);
  const [isRegisterModalOpen, setIsRegisterModalOpen] = useState(false);

  return (
    <Router>
      <div className="App">
        <Navbar
          onLogin={() => setIsLoginModalOpen(true)}
          onRegister={() => setIsRegisterModalOpen(true)}
        />

        <LoginModal isOpen={isLoginModalOpen} onClose={() => setIsLoginModalOpen(false)} />
        <RegisterModal isOpen={isRegisterModalOpen} onClose={() => setIsRegisterModalOpen(false)} />

        <Routes>
          <Route
            path="/"
            element={
              <main className="main-content">
                <div className="premium-services">
                  <div className="text-content">
                    <h1>
                      ENC√ÅRGATE DE <span className="premium">VENDER O DONAR</span> LO QUE NO VAS A USAR
                    </h1>
                    <p className="descripcion-home">Dale una segunda vida a todos los productos que crees que no servir√°n m√°s.</p>
                    <button className="btn-join-2">UNIRSE</button>
                  </div>
                  <div className="image-content">
                    <img src="/assets/images/fondo.png" alt="App Screenshots" className="app-image" />
                  </div>
                </div>

                <div className="opciones-aliados px-6 py-10">
                  <div className="aliados-container-custom rounded-3xl p-8 bg-[#1A1230] shadow-[0_0_20px_2px_rgba(176,70,255,0.6)]">
                    <div className="header-flex">
                      <h2 className="h2">Aliados</h2>
                    </div>
                    <div className="grid grid-cols-2 md:grid-cols-4 gap-10 items-center aliados-grid">
                      {[1, 2, 3, 4, 5, 6].map(num => (
                        <div className="aliado-card" key={num}>
                          <img src={`/assets/images/aliado${num}.${num === 4 ? 'png' : num === 5 ? 'webp' : 'jpg'}`} alt={`aliado${num}`} className="aliado-img" />
                        </div>
                      ))}
                    </div>
                  </div>
                </div>

                <Podras />
                <Rese√±as />
              </main>
            }
          />
          <Route path="/productos" element={<Products />} />
        </Routes>

        <FaqSection />
        <BottomNavbar />
      </div>
    </Router>
  );
}

export default App;
